import './ControlDisplay.css';

function App() {
  return (
    <div className="App">
      <Router>
          <Switch>
              <Route path='/' component={HomeDisplay} exact={true}/>
              <Route path='/home' component={HomeDisplay}/>
              <Route path='/rohinisthegoat' component={ControlDisplay}/>
              {/* <Route component={Page404}/> */}
          </Switch>
      </Router>
    </div>
  );
}

export default App;
